import React, { useContext } from 'react'
import { List as MUIList, ListItem, ListItemAvatar, ListItemText, Avatar, IconButton, Slide, ListItemSecondaryAction } from '@mui/material'
import { Delete, MonetizationOn } from '@mui/icons-material'

import { ExpenseTrackerContext } from '../../../context/context'

const List = () => {

    const { transactions, deleteTransaction } = useContext(ExpenseTrackerContext);

    // const transactions = [
    //     { id: 1, type: "Income", category: "Salary", amount: 50, date: "Jan 21 2024" },
    //     { id: 2, type: "Income", category: "Salary", amount: 50, date: "Jan 21 2024" },
    //     { id: 3, type: "Income", category: "Salary", amount: 50, date: "Jan 21 2024" },
    //     { id: 4, type: "Income", category: "Salary", amount: 50, date: "Jan 21 2024" },
    //     { id: 5, type: "Income", category: "Salary", amount: 50, date: "Jan 21 2024" }
    // ];

    return (
        <MUIList dense={false}>
            {transactions.map((transaction) => (
                <Slide direction="down" in mountOnEnter unmountOnExit key={transaction.id}>
                    <ListItem>
                        <ListItemAvatar>
                            <Avatar className={transaction.type === 'Income' ? classes.avatarIncome : classes.avatarExpense} >
                                <MonetizationOn/>
                            </Avatar>
                        </ListItemAvatar>
                        <ListItemText primary={transaction.category} secondary={`$${transaction.amount} - ${transaction.date}`} />
                        <ListItemSecondaryAction>
                            <IconButton edge="end" aria-label="delete" onClick={() => deleteTransaction(transaction.id)}>
                                <Delete/>
                            </IconButton>
                        </ListItemSecondaryAction>
                    </ListItem>
                </Slide>
            ))}
        </MUIList>
  )
}


export default List;
